The Canadian actress, 30, first showed off her stunning engagement ring from Trevena in February 2014. The couple started dating in mid-2013, and got engaged on on New Year's Eve in 2013, sources previously told Us.&nbsp;
While they had been gearing up for their wedding for about a year, even holding an engagement party in March 2014, the two stars have since parted ways.

